import React, { useState } from "react";
import { createPlant } from "../api/plantAPI";
import { useNavigate } from "react-router-dom";

export default function AddPlant() {
  const navigate = useNavigate();
  const [saving, setSaving] = useState(false);
  const [form, setForm] = useState({
    name: "",
    scientific_name: "",
    plantType: "",
    sunlight: "",
    watering: "",
    soil: "",
    fertilizer: "",
    seasonality: "",
    uses_notes: "",
    image_url: "",
  });

  function onChange(e) {
    const { name, value } = e.target;
    setForm((f) => ({ ...f, [name]: value }));
  }

  async function onSubmit(e) {
    e.preventDefault();
    setSaving(true);
    try {
      const payload = {
        ...form,
        user_email: "guest@example.com", // or current user email if you have auth
      };
      await createPlant(payload);
      navigate("/dashboard");
    } catch (err) {
      console.error("Create failed:", err);
      alert("Failed to add plant");
    } finally {
      setSaving(false);
    }
  }

  return (
    <div className="page pb-24">
      <h1 className="h1 mb-4">➕ Add Plant</h1>

      <form onSubmit={onSubmit} className="card space-y-4">
        <div className="grid sm:grid-cols-2 gap-4">
          <div>
            <label className="label">Name</label>
            <input
              className="input"
              name="name"
              value={form.name}
              onChange={onChange}
              placeholder="Rose"
            />
          </div>
          <div>
            <label className="label">Scientific Name</label>
            <input
              className="input"
              name="scientific_name"
              value={form.scientific_name}
              onChange={onChange}
              placeholder="Rosa rubiginosa"
            />
          </div>
          <div>
            <label className="label">Plant Type</label>
            <input
              className="input"
              name="plantType"
              value={form.plantType}
              onChange={onChange}
              placeholder="Herb/Shrub/Tree"
            />
          </div>
          <div>
            <label className="label">Sunlight</label>
            <input
              className="input"
              name="sunlight"
              value={form.sunlight}
              onChange={onChange}
              placeholder="Full sun / Partial"
            />
          </div>
          <div>
            <label className="label">Watering</label>
            <input
              className="input"
              name="watering"
              value={form.watering}
              onChange={onChange}
              placeholder="Moderate / Weekly"
            />
          </div>
          <div>
            <label className="label">Soil</label>
            <input
              className="input"
              name="soil"
              value={form.soil}
              onChange={onChange}
              placeholder="Loamy / Well-drained"
            />
          </div>
          <div>
            <label className="label">Fertilizer</label>
            <input
              className="input"
              name="fertilizer"
              value={form.fertilizer}
              onChange={onChange}
              placeholder="NPK monthly"
            />
          </div>
          <div>
            <label className="label">Seasonality</label>
            <input
              className="input"
              name="seasonality"
              value={form.seasonality}
              onChange={onChange}
              placeholder="Perennial / Seasonal"
            />
          </div>
        </div>

        <div>
          <label className="label">Uses / Notes</label>
          <textarea
            className="input min-h-[100px]"
            name="uses_notes"
            value={form.uses_notes}
            onChange={onChange}
            placeholder="Medicinal, ornamental, etc."
          />
        </div>

        <div>
          <label className="label">Image URL (optional)</label>
          <input
            className="input"
            name="image_url"
            value={form.image_url}
            onChange={onChange}
            placeholder="http://…"
          />
        </div>

        <div className="flex gap-3">
          <button
            type="submit"
            disabled={saving}
            className="btn-primary disabled:opacity-60"
          >
            {saving ? "Saving…" : "Save"}
          </button>
          <button
            type="button"
            onClick={() => navigate("/dashboard")}
            className="btn-secondary"
          >
            Cancel
          </button>
        </div>
      </form>
    </div>
  );
}
